import React, { useState } from 'react';

const ProjectImage = (props) => {
	const project = props.project;
	console.log(project);

	return (
		<>
			<div>
				<img src={project.sizes.medium} />
				<h2>{project.description}</h2>
			</div>
		</>
	);
};

export default ProjectImage;
